  "guidlines": "<p></p><p>Etymology</p><p>The Old English word 'hlaford' evolved into 'lord'</p><p>According to the Oxford Dictionary of English, the etymology of the word can be traced back to the Old English word hlāford which originated from hlāfweard meaning &#34;loaf-ward&#34; or &#34;bread keeper&#34;, reflecting the Germanic tribal custom of a chieftain providing food for his followers.[3] The appellation &#34;lord&#34; is primarily applied to men, while for women the appellation &#34;lady&#34; is used.[citation needed] However, this is no longer universal: the Lord of Mann, a title currently held by the Queen of the United Kingdom, and female Lord Mayors are examples of women who are styled Lord.[citation needed]</p><p>Historical usage</p><p>Feudalism</p><p>Main articles: Feudalism and English Feudal Baronies</p><p>Under the feudal system, &#34;lord&#34; had a wide, loose and varied meaning. An overlord was a person from whom a landholding or a manor was held by a mesne lord or vassal under various forms of feudal land tenure. The modern term &#34;landlord&#34; is a vestigial survival of this function. A liege lord was a person to whom a vassal owed sworn allegiance. Neither of these terms were titular dignities, but rather factual appellations, which described the relationship between two or more persons within the highly stratified feudal social system. For example, a man might be Lord of the Manor to his own tenants but also a vassal of his own overlord, who in turn was a vassal of the King. Where a knight was a lord of the manor, he was referred to in contemporary documents as &#34;John (Surname), knight, lord of (manor name)&#34;. A feudal baron was a true titular dignity, with the right to attend Parliament, but a feudal baron, Lord of the Manor of many manors, was a vassal of the King.</p><p>Lord of the manor</p><p>See also: Lord of the manor</p><p>The substantive title of &#34;Lord of the Manor&#34; came into use in the English medieval system of feudalism after the Norman Conquest of 1066. The title &#34;Lord of the Manor&#34; was a titular feudal dignity which derived its force from the existence and operation of a manorial court or court baron at which he or his steward presided, thus he was the lord of the manorial court which determined the rules and laws which were to govern all the inhabitants and property covered by the jurisdiction of the court. To the tenants of a certain class of manor known in Saxon times as Infangenthef[4] their lord was a man who had the power of exercising capital punishment over them. The term invariably used in contemporary mediaeval documents is simply &#34;lord of X&#34;, X being the name of the manor. The term &#34;Lord of the Manor&#34; is a recent usage of historians to distinguish such lords from feudal barons and other powerful persons referred to in ancient documents variously as &#34;Sire&#34; (mediaeval French), &#34;Dominus&#34; (Latin), &#34;Lord&#34; etc. The title of &#34;Lord of the Manor&#34; is recognised by the British Government for any such title registered at Her Majesty's Land Registry before 13 October 2003 (the commencement date of the Land Registration Act 2002) but after that date titles can no longer be registered, and any such titles voluntarily de-registered by the holder cannot later be re-registered. However any transfer of ownership of registered manors will continue to be recorded in the register, on the appropriate notification. Thus in effect the register is closed for new registrations.[5] Such titles are legally classified as &#34;incorporeal hereditaments&#34; as they have no physical existence,[6] and usually have no intrinsic value. However a lucrative market arose in the 20th century for such titles, often for purposes of vanity, which was assisted by the existence of an official register, giving the purchaser the impression of a physical existence. Whether a title of &#34;Lord of the Manor&#34; is registered or unregistered has no effect on its legal validity or existence, which is a matter of law to be determined by the courts. Modern legal cases have been won by persons claiming rights as lords of the manor over village greens. The heads of many ancient English land-owning families have continued to be lords of the manor of lands they have inherited.</p><p>The UK Identity and Passport Service will include such titles on a British passport as an &#34;observation&#34; (e.g., 'The Holder is the Lord of the Manor of X'), provided the holder can provide documentary evidence of ownership,[7] as will Passport Canada. The United States [8] however, forbids the use of all titles on passports. Australia forbids the use of titles on passports if those titles have not been awarded by the Crown (in reference to the Australian Monarchy) or the Commonwealth (in reference to the Australian Government).[9]</p><p></p><p><img width=\"500\" src=\"http://app.mimor.com.au/img/uploadedImg/5dc960621a6e7.png\"/></p><p>https://app.mimor.com.au/#/building/406/info/edit</p><p>https://www.facebook.com</p><p>0412272643</p><p>irina@techlantis.com</p><p>+610412272643</p><p>+61412272643</p><p><br/></p>",
