  "email_welcome": "<p></p><p>The term F-test is based on the fact that these tests use the F-statistic to test the hypotheses. An F-statistic is the ratio of two variances and it was named after Sir Ronald Fisher. Variances measure the dispersal of the data points around the mean. Higher variances occur when the individual data points tend to fall further from the mean.</p><p>It’s difficult to interpret variances directly because they are in squared units of the data. If you take the square root of the variance, you obtain the standard deviation, which is easier to interpret because it uses the data units. While variances are hard to interpret directly, some statistical tests use them in their equations.</p><p></p><p><strong>Building address:</strong> [building address]</p><p><strong>Your apartment #:</strong> [apartment name]</p><p><strong>Building on the map:</strong> [building on map]</p><p><strong>Contact name:</strong> [contact name]</p><p><strong>Contact phone:</strong> [contact phone]</p><p><br/></p><p><br/></p><p><img width=\"500\" src=\"http://app.mimor.com.au/img/uploadedImg/60bd6398e0a73.png\"/></p>",
